import * as React from 'react';
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import PhoneIcon from '@mui/icons-material/Phone';
import FavoriteIcon from '@mui/icons-material/Favorite';
import PersonPinIcon from '@mui/icons-material/PersonPin';
import CompanyName from '../assets/Instagram.png'
import styles from './tabular.module.css'


const Tabular = () => {
    const handleChange=()=>{}
    const value=""
    return (
        <Tabs orientation='vertical' value={value} onChange={handleChange} aria-label="icon label tabs example">

<img className={styles.logo} src={CompanyName} alt="logo" height={0} width={200}/>
          <Tab icon={<PhoneIcon color='primary'/>} label="RECENTS" />
          <Tab icon={<FavoriteIcon />} label="FAVORITES" />
          <Tab icon={<PersonPinIcon />} label="NEARBY" />
        </Tabs>
      );
    }


export default Tabular
